import React from "react";
import { Grid, Modal } from 'semantic-ui-react'


const MoreDetails = (props) => {




  return(
    console.log(props),
    <Grid.Column>
      <h1>{props.name}</h1>
      <h1>{props.location}</h1>
      <h1>{props.date}</h1>
      <h1>{props.time}</h1>
    </Grid.Column>
  )

}



export default MoreDetails;
